import React from 'react';
import {Container, Row, Col} from "react-bootstrap";

const roundblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "500px"
}


export const Home = (props) => (
    <>
        <Container>
            <Row className="justify-content-md-center"  >
                <Col md="auto" style = {roundblock}>Variable width content</Col>
            </Row>
            <Row className="justify-content-md-center">
                <Col md="auto">Second Column</Col>
            </Row>
        </Container>

    </>


)
